import { useHistory } from 'react-router';

export const Button = (props) => {
    const history = useHistory();
    const handleClick = () => {
        history.goBack();
    }
    return (
        <div>
        <button style = {{
            display: "flex",
            justifyContent: "center",
            backgroundColor: '#1F6ED4',
            border: 'none', 
            fontSize: '24px', 
            margin: '10px',
            padding: '8px 16px',
            cursor: 'pointer',
            borderRadius: '25px',
            color: 'white'
            }} type="submit" onClick = {handleClick}>
            Previous
        </button>
        <button style = {{backgroundColor: '#50C1E9', border: 'none' , fontSize: '24px', margin: '10px'}} type="submit" disabled = {props.value}>
            Next
        </button>
        </div>       
    )
}
